function removePoster(obj)
{
	$( "#dialog-confirm" ).dialog({
		resizable: false,
		draggable: false,
		height:220,
		modal: true,
		buttons: {
			'Точно': function() {
				$(this).dialog( "close" );
				$(obj).parents('div.file').parent().remove();
			},
			'Отмена': function() {
				$(this).dialog( "close" );
			}
		}
	});
	
	return false;
}



